import React, { useState, useEffect } from 'react';
import './App.css';
import EventSignupForm from './components/EventSignupForm';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function App() {
  const [isLoading, setIsLoading] = useState(false);

  // Optimized background particles - Reduced frequency and count
  useEffect(() => {
    let animationFrameId;
    let particleCount = 0;
    const maxParticles = 5; // Reduced from 10
    const particleInterval = 4000; // Increased from 3000ms

    const createBackgroundParticle = () => {
      if (particleCount >= maxParticles) return;

      const particle = document.createElement('div');
      particle.className = 'particle';
      particle.style.left = Math.random() * 100 + '%';
      particle.style.animationDelay = Math.random() * 10 + 's';

      const container = document.querySelector('.background-particles');
      if (container) {
        container.appendChild(particle);
        particleCount++;

        // Remove particle after animation
        setTimeout(() => {
          if (particle.parentNode) {
            particle.parentNode.removeChild(particle);
            particleCount--;
          }
        }, 15000); // Increased from 10000ms
      }
    };

    // Create initial particles with staggered timing
    for (let i = 0; i < 3; i++) { // Reduced from 10
      setTimeout(createBackgroundParticle, i * 2000); // Increased delay
    }

    // Create particles periodically with reduced frequency
    const interval = setInterval(() => {
      if (particleCount < maxParticles) {
        createBackgroundParticle();
      }
    }, particleInterval);

    return () => {
      clearInterval(interval);
      if (animationFrameId) {
        cancelAnimationFrame(animationFrameId);
      }
    };
  }, []);

  const handleExport = async () => {
    setIsLoading(true);
    try {
      const response = await fetch('http://localhost:5001/api/export', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      if (response.ok) {
        const blob = await response.blob();
        const url = window.URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = `ganesh_utsav_signups_${new Date().toISOString().slice(0, 10)}.csv`;
        document.body.appendChild(a);
        a.click();
        window.URL.revokeObjectURL(url);
        document.body.removeChild(a);
        toast.success('üéâ CSV export completed successfully! üéâ');

        // Add celebration effect
        createCelebration();
      } else {
        const error = await response.json();
        toast.error(error.error || 'Export failed');
      }
    } catch (error) {
      toast.error('Export failed: ' + error.message);
    } finally {
      setIsLoading(false);
    }
  };

  const createCelebration = () => {
    const celebration = document.createElement('div');
    celebration.className = 'success-celebration';

    const elements = ['üéâ', '‚ú®', 'üéä', 'üåü'];
    elements.forEach((element, index) => {
      const celebrationElement = document.createElement('div');
      celebrationElement.className = 'celebration-element';
      celebrationElement.textContent = element;
      celebrationElement.style.animationDelay = `${index * 0.3}s`; // Increased delay
      celebration.appendChild(celebrationElement);
    });

    document.body.appendChild(celebration);

    // Remove celebration after animation
    setTimeout(() => {
      if (celebration.parentNode) {
        celebration.parentNode.removeChild(celebration);
      }
    }, 4000); // Increased from 3000ms
  };

  return (
    <div className="App cultural-theme">
      {/* Background Particles */}
      <div className="background-particles"></div>

      {/* Floating Cultural Elements */}
      <div className="floating-cultural">
        <div className="cultural-element">üïâÔ∏è</div>
        <div className="cultural-element">üå∏</div>
        <div className="cultural-element">üé™</div>
        <div className="cultural-element">üé≠</div>
        <div className="cultural-element">‚ú®</div>
        <div className="cultural-element">üé®</div>
      </div>

      <main className="App-main">
        <EventSignupForm />

        <div className="export-section">
          <button 
            onClick={handleExport}
            disabled={isLoading}
            className={`export-button ${isLoading ? 'loading' : ''}`}
          >
            {isLoading ? 'Processing... üöÄ' : 'Export Signups to CSV üìä'}
          </button>
        </div>
      </main>

      <ToastContainer 
        position="top-right" 
        autoClose={4000} // Reduced from 5000ms
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="light"
        toastStyle={{
          borderRadius: '12px', // Reduced from 15px
          fontFamily: 'Poppins, sans-serif',
          fontSize: '13px', // Reduced from 14px
          fontWeight: '500'
        }}
      />
    </div>
  );
}

export default App;
